    false,nt"url": null,nt"notes": "NODC Accession 0129829 includes physical,
    profile and underway data collected aboard the MELVILLE during cruise MV1215 in
    the North Pacific Ocean on 2012-11-03. These data include CONDUCTIVITY, CURRENT
    SPEED - EAST/WEST COMPONENT (U), CURRENT SPEED - NORTH/SOUTH COMPONENT (V), SALINITY
    and WATER TEMPERATURE. The instruments used to collect these data include ADCP,
    CTD and GPS. These data were collected by David Checkley of University of California
    - San Diego; Scripps Institution of Oceanography as part of Class Cruise SIO280.
    The Lamont-Doherty Earth Observatory (LDEO) submitted these data to NODC as part
    of the NSF sponsored Rolling Deck to Repository (R2R) program.nnThe ADCP data represent
    the raw and automated processed data set. Post processed quality assessed data are
